// To parse this JSON data, do////     final country = countryFromJson(jsonString);import 'dart:convert';Country countryFromJson(String str) => Country.fromJson(json.decode(str));String countryToJson(Country data) => json.encode(data.toJson());class Country {  Country({    this.country,    this.message,    this.status,  });  List<CountryElement> country;  String message;  String status;  factory Country.fromJson(Map<String, dynamic> json) => Country(    country: List<CountryElement>.from(json["country"].map((x) => CountryElement.fromJson(x))),    message: json["message"],    status: json["status"],  );  Map<String, dynamic> toJson() => {    "country": List<dynamic>.from(country.map((x) => x.toJson())),    "message": message,    "status": status,  };}class CountryElement {  CountryElement({    this.id,    this.sortname,    this.name,    this.phonecode,    this.createdAt,    this.updatedAt,  });  int id;  String sortname;  String name;  int phonecode;  dynamic createdAt;  dynamic updatedAt;  factory CountryElement.fromJson(Map<String, dynamic> json) => CountryElement(    id: json["id"],    sortname: json["sortname"],    name: json["name"],    phonecode: json["phonecode"],    createdAt: json["created_at"],    updatedAt: json["updated_at"],  );  Map<String, dynamic> toJson() => {    "id": id,    "sortname": sortname,    "name": name,    "phonecode": phonecode,    "created_at": createdAt,    "updated_at": updatedAt,  };}